import { BsAlarm } from "react-icons/bs";
import { VerticalTimeline, VerticalTimelineElement } from "react-vertical-timeline-component";
import "react-vertical-timeline-component/style.min.css";

import photoPro from "../../../images/photoPro.jpg";
import imta from "./imta.svg";

function Formation() {
	return (
		<VerticalTimeline layout='1-column' lineColor='transparent' className='LOL'>
		<VerticalTimelineElement
			date='2011 - present'
			contentStyle={{ backgroundColor: "transparent" }}
			contentArrowStyle={{ display: "none" }}
			iconStyle={{ background: "rgb(33, 150, 243)", color: "#fff", border: "none" }}>
			<h3>IMT Atlantique</h3>
			<img src={imta} alt="" width="154px" height="100px" style={{position:'absolute', top: '40px', left: '40px', margin: '-40px'}}/>
			<p>Creative Direction, User Experience, Visual Design, Project Management, Team Leading</p>
		</VerticalTimelineElement>
		</VerticalTimeline>
	);
}

export default Formation;
